import React from 'react';
import ReactDom from 'react-dom';
import './index.css'
import Card from './Card'
import Mobiles from './List'

/*console.log(Mobiles[0].title)*/
const mobiledata = Mobiles.map(function(mvalue)
{
    return `${mvalue.title}`;
});
ReactDom.render(
<div className=''>
<h1>Welcome to AK Mobiles</h1>
<Card 
imgsrc={Mobiles[0].imgsrc}
title={mobiledata}
/>
<Card 
imgsrc={Mobiles[1].imgsrc}
title={Mobiles[1].title}
/>
<Card 
imgsrc={Mobiles[2].imgsrc}
title={Mobiles[2].title}
/>
<Card 
imgsrc={Mobiles[3].imgsrc}
title={Mobiles[3].title}
/>
</div>,
document.getElementById('root')
);
